import React from "react";
import { BrowserRouter, Route, Routes, Link } from "react-router-dom";
import Home from "./templates/Home";
import "./App.css";

function App() {
    return (
        <BrowserRouter>
            <Routes>
                <Route path="/wordpress" element={<Home />} />
            </Routes>
        </BrowserRouter>

    );
}

export default App;
